import { useEffect, useState } from "react";
import { getMyPage } from "../api/getMypage";
import Header from "../components/common/Header";

const MyPage = () => {
    const [data, setData] = useState();

    useEffect(()=> {
        getMyPage().then((res) => {
            setData(res);
        });
    }, [])

    return (
        <>
        <Header />
        <div>
            <div>MyPage</div>
            <div>{data?.message}</div>
        </div>
        </>
    );
};

export default MyPage;
